const maxVowels = function (s, k) {
  const map = {
    a: true,
    e: true,
    i: true,
    o: true,
    u: true,
  };
  let count = 0;
  let currentLength = 0;
  let max = 0;
  for (let i = 0; i < s.length; i++) {
    const c = s[i];
    currentLength += 1;
    if (map[c]) {
      count += 1;
    }
    if (currentLength > k) {
      const firstC = s[i - k];
      if (map[firstC]) {
        count -= 1;
      }
      currentLength -= 1;
    }
    max = Math.max(max, count);
    console.log(c, max);
  }
  return max;
};

